import {Link} from "react-router-dom";

function Body() {
    return (
        <>
            <Link to="/Theater" className="text-xl accent-pink-200">Theater</Link>
            <Link to="/Concert" className="text-xl accent-pink-200">Concert</Link>
            <Link to="/StandUp" className="text-xl accent-pink-200">StandUp</Link>
            <Link to="/Cinema" className="text-xl accent-pink-200">Cinema</Link>
            <Link to="/Child" className="text-xl accent-pink-200">Child</Link>
            <Link to="/Filter" className="text-xl accent-pink-200">Filter</Link>

        </>
    )
}
export default Body
